import{_ as e,c as i,a as n,o as p}from"./app-CHiHTJW6.js";const r={};function t(o,a){return p(),i("div",null,[...a[0]||(a[0]=[n('<ul><li><a href="https://github.com/karino2/cppunzip" target="_blank" rel="noopener noreferrer">karino2/cppunzip: Header only unzip library only depend on zlib and STL.</a> githubのレポジトリ</li><li><a href="https://karino2.github.io/2023/09/02/cppunzip_header_only_unzip_library.html" target="_blank" rel="noopener noreferrer">CppUnzip ヘッダーオンリーでzlibだけで動くunzipライブラリを作った - なーんだ、ただの水たまりじゃないか</a> ブログポスト</li></ul><p>C++でzlibとSTLのみに依存しているだけの、ヘッダーオンリーなunzipライブラリ。 メモリに読み込む前提でファイルに書き出さないが、 その辺の事は変えたくなったら変えられるようないじりやすいコードベースを目指して作った。</p><p>[[zip]]を展開するライブラリ。[[自作アプリ]]。</p><h2 id="開発動機" tabindex="-1"><a class="header-anchor" href="#開発動機"><span>開発動機</span></a></h2><p>zlibは割と多くの環境で簡単に使えるようになっているが、C++では意外とzipを開くシステム標準のものは無かったりする。 zlibのcontrib下にあるminizipをラップしたようなライブラリは幾つかあるが、 容易に組み込めるヘッダオンリーなものがなく、 またオンメモリで小さなものを展開して使いたい、みたいな組み込み用途に微妙に大げさなものが多い。</p><p>そこでzlibとSTLのみを使って、標準的なシステムの作るzipだけを開ける程度の、 何かカスタムな用途があればすぐにいじれるような小さなunzipのライブラリを作る事にした。</p>',6)])])}const m=e(r,[["render",t]]),c=JSON.parse('{"path":"/CppUnzip.html","title":"","lang":"en-US","frontmatter":{},"git":{"updatedTime":1693649127000,"contributors":[{"name":"Kazuma Arino","username":"","email":"hogeika2@gmail.com","commits":3}],"changelog":[{"hash":"29627b5e95694091ce34fc91c99a80f1d1c973f6","time":1693649127000,"email":"hogeika2@gmail.com","author":"Kazuma Arino","message":"update"},{"hash":"05ad518cad4be0173a30f71ca59d6c7614152248","time":1693627531000,"email":"hogeika2@gmail.com","author":"Kazuma Arino","message":"update"},{"hash":"effd9a8b8061a76a20e76b6f1ebb6a3ce3f53a81","time":1693620326000,"email":"hogeika2@gmail.com","author":"Kazuma Arino","message":"update"}]},"filePathRelative":"CppUnzip.md"}');export{m as comp,c as data};
